import logo from './logo.svg';
import TasoloGifOraangeBG from '../src/assets/TasoloGifOraangeBG.gif'
import './App.css';

function App() {
  console.log(process.env.REACT_APP_TEST_KEY)
  return (
    <div className="App">
      <h1>{process.env.REACT_APP_TEST_KEY}</h1>
      <header className="App-header">
        <img src={TasoloGifOraangeBG} className="logo" alt="logo" />
      </header>
    </div>
  );
}

export default App;
